import { Layout, theme } from "antd";
import React from "react";
import { Card } from "react-bootstrap";

const AppContent = () => {
  const { Content } = Layout;
  const {
    token: { colorBgContainer },
  } = theme.useToken();
  return (
    <div>
      <Content
        className="fs-5"
        style={{
          margin: "12px",
          padding: 24,
          height: "88vh",
          background: colorBgContainer,
        }}
      >
        {
          <Card
            bg="success"
            style={{ width: "25rem", color: "white", textAlign: "center" }}
            className="mb-2"
          >
            <Card.Header className="fs-4">
              Change SideBar Color Card
            </Card.Header>
            <Card.Body>
              <Card.Title>Card</Card.Title>
              <Card.Text>
                <div

                >
                  <input                   style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid red",
                    borderRadius: "50%",
                    background: "red",
                  }} onClick={()=>console.log('Hi')} type="submit" hidden/>
                </div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
              </Card.Text>
            </Card.Body>
          </Card>
        }
      </Content>
    </div>
  );
};

export default AppContent;
